INSERT INTO `offers` VALUES (100801,'2020-09-23','23:05:20','2020-09-27','23:05:25',1254.00,1053.36,200.64,245.00,'2020-09-23','ueberweisung',254.00,'2020-09-24','ueberweisung','<p>+ Anhnger und Zubehr sind Teilkaskoversichert mit 750  Selbstbeteiligung !</p><p>+ Eine Vollkaskoversicherung besteht nicht !</p><p>+ Spanngurte werden pro Stck mit 2,00  fr die Mietzeit zustzlich zum Mietpreis berechnet !</p><p>+ Der Vertrag wird erst nach Erhalt der gesamten Mietanzahlung bis u.g. Termin verbindlich !</p><p>+ Bei einer Stornierung wird eine Stornogebhr in Hhe der Anzahlung berechnet <strong>!</strong></p><p></p><p></p>','horhausen_westerwald',NULL,1,'2020-09-24 00:07:39','2020-12-06 08:27:04','2020-12-06 08:27:04',20226,1,13,NULL,NULL),(100802,'2020-10-01','11:43:37','2020-10-02','11:43:44',1000.00,840.00,160.00,100.00,'2020-10-01','bar',100.00,'2020-10-01','ec_karte','<ul><li>Anhnger und Zubehr sind Teilkaskoversichert mit 750  Selbstbeteiligung !</li><li>Spanngurte werden pro Stck mit 2,00  fr die Mietzeit zustzlich zum Mietpreis berechnet !</li><li>Fr den Anhnger besteht keine Vollkaskoversicherung.</li><li>Der Mieter erkennt die umseitigen Geschftsbedingungen an.</li><li>Der Vertrag wird erst nach Erhalt der gesamten Mietanzahlung bis u.g. Termin verbindlich !</li><li>Bei einer Stornierung wird eine Stornogebhr in Hhe der Anzahlung berechnet !</li><li>Bei Verlust des Fahrzeugscheins werden 50  fr die Wiederbeschaffung berechnet.</li><li>Der Mieter verpflichtet sich mit seiner Unterschrift, die mitgelieferte Diebstahlsicherung auch im angekuppelten Zustand whrend der gesamten Mietzeit an den Fahrzeugen zu belassen, damit dieser nicht durch unbefugte Dritte entkuppelt werden kann.</li><li><strong>!!! Bei Nichtbeachtung haftet der Mieter selbst fr den Schaden !</strong></li></ul>','horhausen_westerwald',NULL,3,'2020-10-01 13:45:55','2020-12-06 08:27:04','2020-12-06 08:27:04',20227,3,13,NULL,NULL),(100803,'2020-11-30','17:01:47','2020-12-01','12:02:05',50.00,43.10,6.90,